    WriteRegisterByte(RegisterType::E, 0xD8);
    WriteRegisterFlag(0xC0);
    WriteRegisterByte(RegisterType::H, 0x5A);
    WriteRegisterByte(RegisterType::L, 0x77);
    mmap.DisableIME();
    WriteRegisterByte(RegisterType::IE, 0x01);
    WriteMemory(0x15CC, 0x1E);
